async function transferBTC() {
    const address = '';
    const privateKey = '';
    const inputList = [{
        txid: '5b02b4ac20f0668c26d54a5351d8e0f6b37ccee22dd2fab3b532b1fe455c24ff',
        vout: 1,
        value: 891757,
        address: address,
        privateKey: privateKey,
    }];
    const outputList = [];
    for (let i = 0; i < 1; i++) {
        outputList.push({
            address: address,
            value: 891757 - 2000,
        })
    }
    const tx = await UnisatAPI.createPsbt(AddressUtil.convertKeyPair(privateKey), inputList, outputList, address, 12, false, false);
    console.log(JSON.stringify(tx));
}